?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: Times New Roman;">Многие согласятся с таким утверждением, что многие бренды копируют друг друга и повторяют дизайн часов образцов, эдак 40-х или 50-х годов. Но это ни в коем случае не относится к компании Magellan, которая производит высококлассные часы. Из названия марки становится ясно, что названа она в честь знаменитого путешественника и мореплавателя Фернанда Магеллана. Философия данной компании такова: производить исключительно уникальные и высококачественные часы класса люкс. И для реализации этой философии, компания использует инновационные технологии (кстати, компания сама является изобретателем нескольких технологий, которые успешно реализованы в часах Magellan) не как сборки, так и производства часов, которые, в большинстве своем, отличаются от общепринятых стандартов современного производства часов. Корпуса часов произведены из золота (белого, розового или желтого) или из стали, а прочное сапфировое стекло поможет в любых ситуациях избежать повреждения часов. Интересно, что часы Magellan обладают такой функцией, как индикация положения Солнца. Эта компания производит не просто часы, а высокотехнологичные механизмы, в которых отлично сочетаются современные дизайнерские решения и традиции часоделия. Помимо этого, компания является призером нескольких выставок, которые проходили в Швейцарии. Часы Magellan производятся специально для людей с нестандартным образом мышления, которые предпочитают сочетание классики, современности и многофункциональности. </span></span></p>
 
